import dot1 from './image1.png';
import './App.css';
import dot2 from './image2.png';
import './App.css';
import dot3 from './image3.png';
import dot4 from './image4.png';
import dot5 from './image5.png';

function App() {
  return (
    <div className="App">

      <div className="App-sub">
      <h2 className="App-header">Sign up / Sign in design page</h2>
      <p className="App-paragraph">Public</p>
      <img src={dot1} alt="dot1" height={20} width={20} />
      <p>Css updated on 11th of Aug</p>
      </div>

      <div className="App-sub2">
      <img src={dot4} alt="dot4" height={20} width={20} />
      <p>Star</p>
      <img src={dot5} alt="dot5" height={10} width={10} />
      </div>

    </div>
  );
}

export default App;
